    @ServiceMethod(code = "001", description = "获取打坐房间信息")
    public Object getDzRomInfo(AppSocket appSocket, Command command, JSONObject params) {
        long userId = appSocket.getWsidBean().getUserId();
//        long userId = params.getLongValue("userId");
//        if (!isOnline(params.getIntValue("gameId"))) {
//            throwExp("游戏暂未开放");
//        }
        //不走manager 直接拉缓存，处理
        JSONObject result = new JSONObject();
        UserDzPeriods userDzPeriods = dzCacheService.getDzInitInfo();
        //当前期数，上一期不展示
        result.put("periods",userDzPeriods.getPeriods()+1);
        //幸运儿userId
        result.put("luckUserId",userDzPeriods.getUserId());
        result.put("luckUserName",userDzPeriods.getUserName());
        result.put("luckImage",userDzPeriods.getUserImage());
        //幸运儿瓜分的灵石数量
        result.put("cuMoney",userDzPeriods.getCuMoney());
        //报名总人数
        result.put("userDzBmNum",userDzPeriods.getUserDZNum());
        //未打坐人数
        result.put("userNoDkNum",userDzPeriods.getUserDkNum());
        //添加一个状态 1 报名  2 签到  3 领取 getDkStatus(userId+"")
        result.put("dzStatus",getDkStatus(userId+""));
        //这一期报名人数 金币数量
        result.put("nowPeriodsNum", StringUtils.isEmpty(dzCacheService.getUsersNum())?0:dzCacheService.getUsersNum());
        result.put("totalMoney", StringUtils.isEmpty(dzCacheService.getUsersMoney())?BigDecimal.ZERO:dzCacheService.getUsersMoney());
        //userId 参与的总数量
        UserDzRecord record = dzService.selectByUserIdAndPeriods(userId,userDzPeriods.getPeriods()+1);
        if(null == record){
            result.put("joinNum",BigDecimal.ZERO);
        }else {
            result.put("joinNum",record.getDzMoney());
        }
        //用户头像 抽取10人头像 给的是数组 List<String>
        result.put("userTenImageUrl",dzCacheService.getUserImageUrl());
        logger.info("执行结束========" + result.toJSONString());
        return result;

    }

    @ServiceMethod(code = "002", description = "玩家报名参加打坐游戏")
    public Object addUserDzBmInfo(AppSocket appSocket, Command command, JSONObject params) {
        checkNull(params);
        long userId = appSocket.getWsidBean().getUserId();
//        long userId = params.getLongValue("userId");
        Integer periods = params.getInteger("periods");
        BigDecimal bmMoney = params.getBigDecimal("bmMoney");
        if(!isTrueFalse(bmMoney)){
            throwExp("传入错误");
        }
        long time = System.currentTimeMillis();
        if(time<DateUtil.time9() && time >DateUtil.time0()){
            throwExp("不是报名时间");
        }
        params.put("userId", userId);
        params.put("periods", periods);
        params.put("bmMoney", bmMoney);
        //manager 中，定义了 035  001
        Executer.request(TargetSocketType.manager, CommandBuilder.builder().request("035002", params).build(),
                new RequestManagerListener(command));
        return async();

    }

    @ServiceMethod(code = "003", description = "玩家打坐签到本次打坐游戏")
    public Object updateUserDzInfo(AppSocket appSocket, Command command, JSONObject params) {
        checkNull(params);
        //判断用户是否可以签到 时间限制
//        if(!getDKTime()){
//            throwExp("还未到打坐时间！");
//        }
        long userId = appSocket.getWsidBean().getUserId();
//        long userId = params.getLongValue("userId");
        params.put("userId", userId);
        long time = System.currentTimeMillis();
        if(!(time<DateUtil.time8() && time>DateUtil.time5())){
            throwExp("不是时间内");
        }
        if(dzCacheService.getUserDkInfo(userId)){
            throwExp("您已参与，请勿重复操作");
        }
        //manager 中，定义了 035  001
        Executer.request(TargetSocketType.manager, CommandBuilder.builder().request("035003", params).build(),
                new RequestManagerListener(command));
        return async();
    }

    @ServiceMethod(code = "004", description = "玩家领取上一期的灵石瓜分")
    public Object addUserMoneyInfo(AppSocket appSocket, Command command, JSONObject params) {
        checkNull(params);
        //领取，判断用户是否可以领取
        long userId = appSocket.getWsidBean().getUserId();
       // long userId = params.getLongValue("userId");
        params.put("userId", userId);
        long time = System.currentTimeMillis();
        if(time < DateUtil.time9()){
            throwExp("系统结算中，请9点后领取");
        }
        //manager 中，定义了 035  001
        Executer.request(TargetSocketType.manager, CommandBuilder.builder().request("035004", params).build(),
                new RequestManagerListener(command));
        return async();

    }
    public int getDkStatus(String userId){
        boolean flag = dzCacheService.getUserLqInfo(userId);
        if(flag){
            return DzStatus.LQ_STATUS.getValue();//领取
        }
        long Time = System.currentTimeMillis();
        if(Time>DateUtil.time5() && Time <DateUtil.time8()){
            if(dzCacheService.getUserDkInfo(Long.parseLong(userId))){
                return DzStatus.DK_H_STATUS.getValue();//签到置灰
            }
            return DzStatus.DK_STATUS.getValue();//签到
        }
        if(Time>DateUtil.time0() && Time <DateUtil.time9()){
            return DzStatus.BM_H_STATUS.getValue();//报名置灰
        }
        return DzStatus.BM_STATUS.getValue();
    }

    //判断金额
    public boolean isTrueFalse(BigDecimal money){
        return new BigDecimal("1").compareTo(money) == 0
                || new BigDecimal("10").compareTo(money) == 0
                || new BigDecimal("100").compareTo(money) == 0
                || new BigDecimal("1000").compareTo(money) == 0;
    }



