    @ServiceMethod(code = "005", description = "清除redis中的userId")
    public void delRedisUserId() {
        //查库，根据userId 查一下这个用户能不能领取
        //插入几个userId
//        List<String> userIds = new ArrayList<>();
//        userIds.add("123");
//        userIds.add("456");
//        userIds.add("193826");
//        userIds.add("193879");
//        dzCacheService.set(RedisKeyConstant.APP_USER_DZ_LQ_USERID_NOW,userIds);


        List<String> lists = dzCacheService.getList(RedisKeyConstant.APP_USER_DZ_LQ_USERID_NOW, String.class);
        if (null != lists) {
            for (String s : lists) {
                List<UserDzRecord> userDzRecords = dzService.selectByStatusUserId(Long.parseLong(s));
                if (null == userDzRecords || userDzRecords.isEmpty()) {
                    logger.info("从redis中清除userId->" + s);
                    dzCacheService.removeLqUserId(s);
                    logger.info("该【" + s + "】 已经被清除");
                }else {
                    logger.info("该【" + s + "】 有未领取的奖励，不能删除");
                }
            }
        }else {
            logger.info("redis 为空---------------------------");
        }
    }

    @ServiceMethod(code = "006", description = "根据期数查询排行榜")
    public Object queryOrderByPeriods(AppSocket appSocket, Command command, JSONObject params) {
        Integer curPage = params.getInteger("curPage");
        if (null == curPage || curPage < 1) params.put("curPage", 1);
        Integer pageSize = params.getInteger("pageSize");
        if (null == pageSize || pageSize < 1) params.put("pageSize", 50);
        JSONObject result = new JSONObject();
        result.put("code", 200);
        result.put("message", "根据期数查询排行榜成功");
        JSONObject data = new JSONObject();
        Map<String, Object> par = new HashMap<>();
        par.put("curPage", (curPage - 1) * pageSize);
        par.put("pageSize", pageSize);
        Integer periods = params.getInteger("periods");
        if (null == periods || periods < 1) periods = null;
        par.put("periods", periods);
        // 排行榜
        List<UserDzRecordVO> userDzRecordList;
        synchronized (Objects.requireNonNull(periods)) {
            userDzRecordList = dzService.queryOrderByPeriods(par);
            data.put("list", userDzRecordList);
        }
        // 当前排行榜信息
        long userId = appSocket.getWsidBean().getUserId();
        Map<String, Object> userIdMap = new HashMap<>();
        userIdMap.put("userId", userId);
        UserDzRecordVO userDzRecord = dzService.queryOrderByUserId(userIdMap);
        data.put("mydata", userDzRecord);
        // 上榜
        data.put("hasInBang", false);
        if (!CollectionUtils.isEmpty(userDzRecordList)) {
            for (int i = 0; i < userDzRecordList.size(); i++) {
                if (userDzRecordList.get(i).getUserId().equals(userId)) {
                    data.put("hasInBang", true);
                    data.put("mydata", userDzRecordList.get(i));
                }
            }
        }
        result.put("data", data);
        return data;
    }

