    public void selectNoDkUserIds(){
        List<String> userIds1 = new ArrayList<>();
        List<String> userIds2 = new ArrayList<>();


        //第一期未打卡的人
        List<UserDzRecord> noDkUserIds1  =  dzService.selectNoDkUserIds(1,1);
        //第一期打卡的人
        List<UserDzRecord> dkUserIds1  =  dzService.selectNoDkUserIds(2,1);
        //第一期领取的人
        List<UserDzRecord> lqUserIds1  =  dzService.selectNoDkUserIds(3,1);
        //第二期未打卡的人
        List<UserDzRecord> noDkUserIds2  =  dzService.selectNoDkUserIds(1,2);
        //第二期打卡的人
        List<UserDzRecord> dkUserIds2  =  dzService.selectNoDkUserIds(2,2);
        //第二期领取的人
        List<UserDzRecord> lqUserIds2  =  dzService.selectNoDkUserIds(3,2);
        //先处理第一期
        dkUserIds1.addAll(lqUserIds1);
        for(UserDzRecord userDzRecord :dkUserIds1){
            for(UserDzRecord record : noDkUserIds1){
                if(String.valueOf(userDzRecord.getUserId()).contains(String.valueOf(record.getUserId()))){
                    userIds1.add(String.valueOf(record.getUserId()));
                    noDkUserIds1.remove(String.valueOf(record.getUserId()));
                }
            }
        }
        //处理第二期
        dkUserIds2.addAll(lqUserIds2);
        for(UserDzRecord userDzRecord : dkUserIds2){
            for (UserDzRecord record : noDkUserIds2){
                if(String.valueOf(userDzRecord).contains(String.valueOf(record.getUserId()))){
                    userIds2.add(String.valueOf(record.getUserId()));
                    noDkUserIds2.remove(String.valueOf(record.getUserId()));
                }
            }
        }

        dzCacheService.set("t:app:one:dz:periods:userIds",userIds1);
        logger.info("第一期被包含的userId，已经放入redis缓存中，个数->" + userIds1.size());

        dzCacheService.set("t:app:two:dz:periods:userIds",userIds2);

        logger.info("第二期被包含的userId，已经放入redis缓存中，个数->" + userIds2.size());
    }


    public void updatePeriods16Data() {
        //查出数据
        List<UserDzRecord> userDzRecords = dzService.getUsersDz16();
        if (userDzRecords.isEmpty()) {
            throwExp("数据为空");
        }
        int num = 0;
        for (UserDzRecord record : userDzRecords) {
            synchronized (LockUtil.getlock(record.getUserId() + "")) {
                BigDecimal amount = record.getDzMoney().subtract(record.getReturnMoney());
                UserDzRecord recordData = dzService.selectByUserIdAndPeriods(record.getUserId(), 17);
                if (null == recordData) {
                    long a = dzService.addUserRecord(record.getUserId(), amount, 17);
                    if (a < 1) {
                        throwExp("执行add失败!!!");
                    }
                } else {
                    //update
                    recordData.setDzMoney(record.getDzMoney().add(amount));
                    long c = dzService.updateUsersDzMoney(recordData);
                    if (c < 1) {
                        throwExp("执行update失败!!");
                    }
                }
            }
            num = num +1;
        }
        logger.info("修复数据完成，修复条数->" + num);
    }

